English Lyrics:
I love Thee because Thou hast first loved me, And purchased my pardon On Calvary's tree; I love Thee for wearing the throne on Thy brow;
If ever I loved Thee, my Jesus 
'its now.

God, give us Chris-tian homes! Homes where the Bi-bie is Loved and taught, Homes where the Mas-ter's will is sought,
Homes crowned with beau-ty 
Thy love hath wrought; 
God, give us Chris-tian homes; 
God give us Chris-tian homes!
